import React, { useState } from 'react';
import './Dashboard.css'; // Ensure you have the dark theme CSS here

const App = () => {
  // Define state for active tab and theme
  const [activeTab, setActiveTab] = useState('home'); // Initialize activeTab state
  const [theme, setTheme] = useState('dark');

  // Function to toggle theme between light and dark
  const toggleTheme = () => {
    setTheme((prevTheme) => (prevTheme === 'dark' ? 'light' : 'dark'));
    document.body.classList.toggle('light-theme', theme === 'dark');
  };

  // Sample data for interviewers and candidates
  const interviewers = [
    { name: 'John Doe', email: 'john@example.com' },
    { name: 'Jane Smith', email: 'jane@example.com' },
    { name: 'Alice Johnson', email: 'alice@example.com' },
  ];

  const candidates = [
    { name: 'Bob Brown', email: 'bob@example.com' },
    { name: 'Charlie Davis', email: 'charlie@example.com' },
    { name: 'Eve White', email: 'eve@example.com' },
  ];

  return (
    <div className={`dashboard ${theme}`}>
      <nav className="navbar">
        <ul>
          <li onClick={() => setActiveTab('home')}>Home</li>
          <li onClick={() => setActiveTab('interviewers')}>Interviewers</li>
          <li onClick={() => setActiveTab('candidates')}>Candidates</li>
          <li onClick={() => setActiveTab('reports')}>Reports</li>
          <li onClick={toggleTheme}>Settings: {theme === 'dark' ? 'Light' : 'Dark'}</li>
        </ul>
      </nav>

      {activeTab === 'home' && (
        <div>
          <h1>Upcoming Interviews</h1>
          <p>No upcoming interviews scheduled.</p>
        </div>
      )}

      {activeTab === 'interviewers' && (
        <div>
          <h1>Interviewers</h1>
          <table>
            <thead>
              <tr>
                <th>Name</th>
                <th>Email ID</th>
                <th>More Details</th>
              </tr>
            </thead>
            <tbody>
              {interviewers.map((interviewer, index) => (
                <tr key={index}>
                  <td>{interviewer.name}</td>
                  <td>{interviewer.email}</td>
                  <td><button>Details</button></td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {activeTab === 'candidates' && (
        <div>
          <h1>Candidates</h1>
          <table>
            <thead>
              <tr>
                <th>Name</th>
                <th>Email ID</th>
                <th>More Details</th>
              </tr>
            </thead>
            <tbody>
              {candidates.map((candidate, index) => (
                <tr key={index}>
                  <td>{candidate.name}</td>
                  <td>{candidate.email}</td>
                  <td><button>Details</button></td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {activeTab === 'reports' && (
        <div>
          <h1>Reports</h1>
          <div>Total Interviews: 0</div>
          <div>Upcoming Interviews: 0</div>
          <div>Completed Interviews: 0</div>
        </div>
      )}
    </div>
  );
};

export default App;
